b'Don\xe2\x80\x99t unplug! Why the world\xe2\x80\x99s most connected person argues for even more #connectivity?

@chrisdancy is not your average person. In fact, even he will tell you he\xe2\x80\x99s more cyborg than human. And, watching him parse information at supercomputer speeds, the man known as the world\xe2\x80\x99s most connected person may leave you just a little unsure about who has shown up for our interview on Zoom: the man or the machine. But let him speak, and you will know. The giveaway is in his humanity, in the capacity to track his data with a clear purpose of identifying what is most valuable to the human experience. And it is #5G that he believes will make us all more human.

#mindfulcyborg'

b'National Broadband Ireland (NBI) has selected Nokia to deploy a nation-wide fiber-to-the-home network solution in the Republic of Ireland over the full programme delivery period for the Irish Government\xe2\x80\x99s landmark National Broadband Plan (NBP). The project is one of the most ambitious government broadband plans in the world, with the goal of providing high-speed connectivity to all of Ireland\xe2\x80\x99s population, including 23% of whom currently live in the more rural Intervention Area (IA) where the NBP will be focused.

It involves more than 44,000 non-farm businesses, over 54,000 farms and 695 schools, ensuring that no one is left behind and laying the foundation for Ireland\xe2\x80\x99s digital future for generations.

@nationalbroadbandireland #FTTH'
